import '../style/categories.css'
const Category = () => {
    return ( 
        <div className="categories">
            <div className="categories_links">
                <a href="">All</a>
                <a href="">Live</a>
                <a href="">Music</a>
                <a href="">Comedy</a>
                <a href="">Sports</a>
                <a href="">Gaming</a>
                <a href="">Vlogs</a>
            </div>
        </div>
     );
}
 
export default Category;
